import React from 'react'
import './Enterprise.css'

function Enterprise() {
    return (
        <div className='enterprise'>
            <div className="wa">
            <h1>Social Enterprise</h1>
            <p>Enhancing upward mobility of the under-privileged by promoting their self-driven learning and equipping them with free tools and resources to level the DSE playing field versus a well-provided peer</p>
            </div>
        </div>
    )
}

export default Enterprise
